import { Injectable } from '@nestjs/common';
import * as fs from 'fs';
import * as path from 'path';

export interface TodoItem {
  text: string;
  done: boolean;
}

@Injectable()
export class AppService {
  getHello(): string {
    return 'Hello World';
  }

  getTodosFromFile(): TodoItem[] {
    // Path to root/todo.md from server/src
    const filePath = path.join(__dirname, '..', '..', 'todo.md');
    let content = '';
    try {
      content = fs.readFileSync(filePath, 'utf8');
    } catch (e) {
      // If file not exists or unreadable, return empty array
      content = '';
    }

    const items: TodoItem[] = [];
    const lines = content.split(/\r?\n/);
    for (const line of lines) {
      const trimmed = line.trim();
      // Match markdown task syntax: - [ ] Task or - [x] Task
      const m = /^-\s*\[( |x|X)\]\s*(.*)$/.exec(trimmed);
      if (m) {
        const done = /^-\s*\[(x|X)\]/.test(trimmed);
        const text = m[2].trim();
        items.push({ text, done });
      }
    }
    return items;
  }
}

