import React, { useEffect, useState } from 'react';
import './App.css';
import axios from 'axios';

type TodoItem = {
  text: string;
  done: boolean;
};

function App(): JSX.Element {
  const [todos, setTodos] = useState<TodoItem[]>([]);
  const [loading, setLoading] = useState<boolean>(true);

  const loadTodos = async () => {
    try {
      const res = await axios.get<TodoItem[]>('/todos');
      setTodos(res.data ?? []);
    } catch (err) {
      console.error('Failed to load todos from server', err);
      setTodos([]);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    loadTodos();
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h1>Web3 Fullstack Demo</h1>
      </header>
      <main>
        <section>
          <h2>Server Todo</h2>
          {loading ? (
            <p>Loading...</p>
          ) : (
            <ul>
              {todos.map((t, idx) => (
                <li key={idx} style={{ textDecoration: t.done ? 'line-through' : 'none' }}>
                  {t.text} {t.done ? '(done)' : ''}
                </li>
              ))}
            </ul>
          )}
        </section>
      </main>
    </div>
  );
}

export default App;

